		var cont = 0;
		var contador = 1;
		var seleccion = ["", "", ""];
		var correcto = "";
		var respuestas = "";
		var corr = 0;
		root.p3.text = ("Selecciona 3 pasos del mapa general del proceso Gestión del Talento.");
		root.c3_op0.text = ("Sesión de Sucesión.");
		root.c3_op1.text = ("Perfil de Éxito.");
		root.c3_op2.text = ("Evaluación de Potencial y Desempeño.");
